import React, { useEffect } from 'react';
import './App.css';

// Bootstrap CSS:
import 'bootstrap/dist/css/bootstrap.min.css';
import QuemSomos from './Components/QuemSomos.jsx';
// AOS:
import AOS from 'aos';
import 'aos/dist/aos.css';

// Components
import HomePage from './pages/HomePage';

function App() {
    useEffect(() => {
        AOS.init();
    }, []);

    return (
        <React.Fragment>
            <ScrollArrow />
            <Header />

            <CardapioCarousel />
            <Cardapio className="pratos" />

            <QuemSomos className="about" id="about" />

            <AmbienteExterno className="local" />
            <AmbienteInterno />

            <Footer className="contatos" />
        </React.Fragment>
    );
}

export default App;
